import React from 'react';
import style from '../styles/navbar.module.css'

const Navbar = () => {
    return (
        <div className={style.container}>
            <h1>Home</h1>
            <h1>About</h1>
            <h1>Skills</h1>
            <h1>Projects</h1>
            <h1></h1>
        </div>
    );
};

export default Navbar;
